import './App.css';
import React, {useState} from "react";

function App(props) {
  const [user, setUser] = useState("Eduarda")
  return (
    <div>
      <h1> {props.title} {props.user}</h1>
      <p>{user}</p>
      <input name="user" id="user" className="userInput" placeholder="User" />
      <button type="button">Pesquisar</button>
    </div>
  );
}

export default App;
